import React from 'react';
import { GoogleMap } from 'react-google-maps';

function Map() {
    return(
        <GoogleMap 
            defaultZoom={10} 
            defaultCenter={{lat: 51.600118, lng: 5.226617}}
        />
    )
}



export default function Maps() {
    return (
        <div style={{color: 'white'}}>
            map here
        </div>
    )
}
